	/// * * 
	//
	// *   Query  ::= ( Clause )*
	//
	// *   Clause ::= ["+", "-"] [<TERM> ":"] ( <TERM> | "(" Query ")" )
	//
	// * * / // Right associativity. Why? See http://blog.efftinge.de/2010/08/parsing-expressions-with-xtext.html
	//
	//Exp1 returns Expression:
